@csrf_exempt
def patient_statistics(request):
    if not request.user.is_authenticated or (
            request.user.username != "admin" and request.user.groups.all()[0].name not in ["doctors_group", "admins_group"]):
        return redirect("login")

    email = request.GET['email']
    person = User.objects.get(username=email).person
    p = Patient.objects.get(person=person)
    patient_gestures = list(Gesture.objects.filter(patient=p))

    gestures_dict = {}
    for g in patient_gestures:
        gestures_dict[str(g.id)] = [g.name, g.patient_difficulty, g.default_difficulty]

    #get patient games
    games_quant = [ [], []]
    pat_gestures = (Gesture.objects.filter(patient=p))
    game_names = [g.game.name for g in GamePlayed.objects.all() if g.gesture in pat_gestures]

    for n in game_names:
        if n not in games_quant[0]:
            count = len([x for x in game_names if x ==n])
            games_quant[0].append(n)
            games_quant[1].append(count)


    notes_form = UpdateNotes(p)
    add_gesture_form = AddGesture()
    remove_gesture_form = RemoveGesture()

    if request.method == 'POST':

        if "gesture_name" and "user_email" in request.POST:
            gesture_form = RemoveGesture(request.POST, request.FILES)
            if gesture_form.is_valid():

                email = gesture_form.cleaned_data["user_email"]
                name = gesture_form.cleaned_data["gesture_name"]
                gestures = list(Gesture.objects.all())
                g = [g for g in gestures if g.patient.person.user.username == email and g.name == name]

                if len(g) == 1:
                    g = g[0]
                    g.delete()

                # update gestures
                patient_gestures = list(Gesture.objects.filter(patient=p))

                return render(request, "patient_statistics.html",
                              {"form": add_gesture_form, "form_notes": notes_form, "gesture_form": remove_gesture_form,
                               "patient": p, "patient_gestures": patient_gestures,
                               "gestures_dict": gestures_dict, "games_quant":games_quant})

            print("DELETE GESTURE")
        if "notes" not in request.POST:
            form = AddGesture(request.POST, request.FILES)
            if form.is_valid():
                g = Gesture(patient=p, name=form.cleaned_data["name"], image=form.cleaned_data["gesture_image"],
                            repetitions=form.cleaned_data["repetitions"],
                            default_difficulty=form.cleaned_data["default_difficulty"],
                            patient_difficulty=0, decision_tree=form.cleaned_data["decision_tree"])

                g.save()
                patient_gestures = list(Gesture.objects.filter(patient=p))

                return render(request, "patient_statistics.html",
                              {"form": add_gesture_form, "form_notes": notes_form, "gesture_form": remove_gesture_form,
                               "patient": p, "patient_gestures": patient_gestures,
                               "gestures_dict": gestures_dict, "games_quant":games_quant})
            else:
                print("Invalid form")
        else:
            form = UpdateNotes(None, request.POST, request.FILES)
            if form.is_valid():

                Patient.objects.filter(person=person).update(notes=form.cleaned_data["notes"])
                p = Patient.objects.get(person=person)
                notes_form = UpdateNotes(p)
                return render(request, "patient_statistics.html",
                              {"form": add_gesture_form, "form_notes": notes_form, "gesture_form": remove_gesture_form,
                               "patient": p, "patient_gestures": patient_gestures,
                               "gestures_dict": gestures_dict})
            else:
                print("Invalid form")

    return render(request, "patient_statistics.html",
                  {"form": add_gesture_form, "form_notes": notes_form, "gesture_form": remove_gesture_form,
                   "patient": p, "patient_gestures": patient_gestures, "gestures_dict": gestures_dict, "games_quant":games_quant})


