@csrf_exempt
def add_patient(request):
    # if user is not an admin or isnt authenticated-> login
    if not request.user.is_authenticated or (request.user.username != "admin" and request.user.groups.all()[0].name not in ["admins_group", "doctors_group"]):
        return redirect("login")

    if request.method == 'POST':
        form = AddPatient(request.POST, request.FILES)

        if form.is_valid():
            # get info form form
            form_data = form.cleaned_data
            first_name = form_data["first_name"]
            last_name = form_data["last_name"]
            contact = form_data["contact"]
            email = form_data["email"]
            photo = form_data["photo"]
            birth_date = form_data["birth_date"]
            nif = form_data["nif"]

            if photo != None:
                photo_b64 = base64.b64encode(photo.file.read())
                photo_b64 = photo_b64.decode()
            else:
                photo_b64 = ""

            # check for unique constraints

            if list(User.objects.filter(username=email)) != []:
                error_message = "There is already a user with this email! The patient WASN'T added to database!"
                return render(request, "add_patient.html", {'form': form, "state":"error", "state_message":error_message})

            if list(Person.objects.filter(nif=nif)) != []:
                error_message = "There is already a user with this nif! The patient WASN'T added to database!"
                return render(request, "add_patient", {'form': form, "state":"error", "state_message":error_message})

            try:
                # generate pw and send email
                pw = send_email_pw(email)
            except:
                pw = "pw"

            # create a user
            u = User.objects.create_user(username=email, first_name=first_name, last_name=last_name, password=pw)
            u.is_active = False
            u.save()

            # link the user to a person
            p = Person.objects.create(user=u, contact=contact, nif=nif, birth_date=birth_date, photo_b64=photo_b64)
            p.save()

            # link the person to a patient
            pat = Patient.objects.create(person=p, notes="Notes test")
            pat.save()

            # check if the group doctors exists, else create it
            # finally add doctor to group
            patients_group = list(Group.objects.filter(name='patients_group'))

            if len(patients_group) == 0:
                patients_group = Group.objects.create(name='patients_group')
                patients_group.save()

            patients_group = Group.objects.get(name='patients_group')
            patients_group.user_set.add(u)

            form = AddPatient()

            state_message = "The patient was added to database.Check your email for the password"
            return render(request, "add_patient.html", {'form': form,  "state":"success", "state_message":state_message})
        else:
            print("Invalid form")
    else:
        form = AddPatient()
    return render(request, "add_patient.html", {'form': form,  "state":None})

